function App() {
  return (
    <div>
      <div className="myBG">
        <NavigationBar />
        <Intro />
      </div>
      <div className="AddMovie">
        <AddMovie />
      </div>

      <div className="trending">
        <Trending />
      </div>
    </div>
  );
}

export default App;
